import "/home/marv/the-odin-project/react-projects/anime-search/src/Leaderboard/leaderboard.css";

export default function LeaderBoard(props) {

  const {blogs} = props;

  const removeQuotes = string => string.replaceAll("\"", "").replaceAll("{","").replaceAll("}","").replaceAll(",","");

  return (
    <div className="leaderboard-wrapper">
      <div className="leaderboard">
        <h1>LEADERBOARD</h1>
        {
        blogs && blogs.map((blog, index)=>{
          return(
            <div key={index} className="board-output">
              <p>{removeQuotes(JSON.stringify(blog)) + '<br/>'}</p>
            </div>
          )
        })
      }
      </div>
    </div>
  );
}
